    render() {

        return (
            <div className="homeInfoCard">
                <motion.ul  initial="hidden" animate="show" className="home-page-info">
                    <motion.li  style={{fontSize: "7vh"}}>Andrew Zajac</motion.li>
                    <motion.li  style={{fontSize: "2.5vh"}}>Software Engineer</motion.li>
                </motion.ul>


            </div>
        )
    }
}

export default HomePage
